import React from "react";
import styled from "styled-components";

const NavbarContainer = styled.nav`
  display: flex;
  align-items: center;
  justify-content: space-between;
  background-color: #1b2838;
  padding: 10px 20px;
  color: #ffffff;
`;

const Logo = styled.div`
  font-size: 1.5rem;
  font-weight: bold;
  cursor: pointer;
  color: #c7d5e0;
`;

function Navbar() {
  return (
    <>
      <NavbarContainer>
        <Logo>STEAM</Logo>
      </NavbarContainer>
    </>
  );
}

export default Navbar;
